export function getRequest(url) {
    
    var config = {
        headers: {
            'Content-Type': 'application/json',
            'Accept': 'application/json',
            'Access-Control-Allow-Origin': '*'
        },
    };
    debugger;
    //fetch('https://jsonplaceholder.typicode.com/todos/1')
    fetch(url, config)
        .then((results) => results.json())
        .then((data) => {
        return data;
        })
}
